def nn(ti, t, s):
  li = s.rfind(t, 0, max(ti, 0))
  ri = s.find(t, min(ti+1, len(s)), len(s))
  if li==-1: li = -11
  if ri==-1: ri = len(s)+11
  return min(ti-li, ri-ti) - 1
def ok(n):
  strn = str(n)
  if any(strn.count(c)==1 for c in set(strn)): return False
  for i, c in enumerate(strn):
    if nn(i, c, strn) != int(c): return False
  return True
